import React from 'react';
import problem from "./components/problem";
import { Link } from "react-router-dom";

class Header extends React.Component {
    render() {
        return (

            <div className="w3-bar w3-black  w3-card" id="myNavbar">
                <a href="/" className="w3-bar-item"
                   style={{padding: '8px 16px', fontfamily: 'Gloria Hallelujah', fontweight: 100, fontsize: 'x-large',  textdecoration: 'none'}}>
                    astro-problems
                </a>
                <Link to="/problem"
                   className="w3-bar-item w3-button w3-padding-16"><i className="fab fa-wpexplorer"></i> Задачи</Link>




            </div>

        )
    }
}

export default Header;
